import { Box, Drawer, makeStyles, Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Typography } from "@material-ui/core";

const drawerWidthRight = 280

const useStyles = makeStyles((theme) =>{
    return{
        root:{
            
        },
        navRight:{
            width: drawerWidthRight,
            //display:'none'
        },
        drawerPaperRight:{
            width : drawerWidthRight,
            backgroundColor:"#FFFFF",
            borderLeft:'0px'

        },

}})

const ServerColumns = [
    { prod: 'SW11203', hProd: 'SW11213', dev: "SW11003" },
    { prod: 'SW11203', hProd: 'SW11213', dev: "SW11003" },
    { prod: 'SW11203', hProd: 'SW11213', dev: "SW11003" },
    { prod: 'SW11203', hProd: 'SW11213', dev: "SW11003" },
  ];

  

const RightNav = () => {
    const classes = useStyles()
    return ( 
        <div>
            
            <Drawer
            elevation={0}
            variant = "permanent"
            anchor = 'right'
            classes = {{paper : classes.drawerPaperRight}}
            className={classes.navRight}
            >                
                <Box>
                    <Box m={2} display="flex" justifyContent="center">
                        <Typography gutterBottom>
                            Informations                                      
                        </Typography>
                    </Box>
                    
                    <Box>
                        <TableContainer>
                            <Table size="small">
                                <TableHead  >
                                    <TableRow >
                                        <TableCell size="small">Prod</TableCell>
                                        <TableCell size="small">h-Prod</TableCell>
                                        <TableCell size="small">DEV</TableCell>
                                    </TableRow>
                                </TableHead>
                                <TableBody>
                                {ServerColumns.map((server) =>{
                                    
                                    <TableRow >
                                        <TableCell size="small">{server.prod}</TableCell>
                                        <TableCell size="small">{server.hProd}</TableCell>
                                        <TableCell size="small">{server.dev}</TableCell>
                                    </TableRow>
                                    
                                })}
                                </TableBody>
                            </Table>
                        </TableContainer>
                    </Box>
                </Box>
            </Drawer>
        
        </div> 
     );
}
 
export default RightNav
